import NavbarComponent from "./NavbarComponent";
import Footer from "./Footer";

// Javascript
import "../assets/js/fontawesome.js";

const Layout = props => (
  <div>
    <NavbarComponent />
    {props.children}
    <Footer />
  </div>
);

export default Layout;
